import React from "react";

const dotLine = ({ lineAtStart }) => {
  return (
    <div
      className={`line-with-dots ${
        lineAtStart ? "line-at-start" : "line-at-end"
      }`}
    >
      <div className="dot"></div>
      <div className="dot"></div>
      <div className="dot"></div>
      <div className="line"></div>
    </div>
  );
};

export default dotLine;
